import React from "react";
import Svg from "../Svg";
import { SvgProps } from "../types";

interface LogoProps extends SvgProps {
  isDark: boolean;
}

const Logo: React.FC<LogoProps> = ({ isDark, ...props }) => {
  const textColor = isDark ? "#FFFFFF" : "#000000";
    return (    
      <Svg id="svg" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="400" height="40" viewBox="0, 0, 400, 40" {...props}>
        <image  width="395" height="65" id="img1" href="data:image/png;base64,"/>
      </Svg>
  );
};

export default React.memo(Logo, (prev, next) => prev.isDark === next.isDark);
